import React, { useState } from "react";
import Nav from "react-bootstrap/Nav";
import styles from "./nav.module.scss";

const NavBar = () => {
  const navItems = [
    {
      id: 1,
      title: "База анкет сотрудников",
    },
    {
      id: 2,
      title: "Общая база сотрудников",
    },
    {
      id: 3,
      title: "База сотрудников",
    },
    {
      id: 4,
      title: "Календарь сотрудников",
    },
  ];
  const [activeItem, setActiveItem] = useState(2);

  const hancleClickNavItem = (id: number) => {
    setActiveItem(id);
  };
  return (
    <Nav
      // variant="tabs" defaultActiveKey="/home"
      className={styles.Nav}
    >
      {navItems.map((item) => (
        <Nav.Item className={styles.NavItem} key={item.id}>
          <Nav.Link className={styles.NavItemLink} href="/home">
            {item.title}
          </Nav.Link>
        </Nav.Item>
      ))}
    </Nav>
  );
};

export default NavBar;
